import React from 'react';
import '../styles/Search.css';

import SearchField from '../components/SearchField.jsx';

const Search = () => {
    return (
        <div
            className={'search__root'}>
            <div
                className={'search__wrapper'}>
                <div
                    className={'search__title'}>
                </div>
                <SearchField />
            </div>
        </div>
    );
}

export default Search;
